// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

/**
 * @title JobAuction
 * @dev Contract independent care gestioneaza licitatia pentru un anumit job.
 */
contract JobAuction {
    address public jobOwner;       // Adresa proprietarului jobului
    address public highestBidder;  // Adresa cu bid-ul cel mai mare
    uint256 public highestBid;     // Cel mai mare bid
    bool public auctionActive;     // Licitația e activă sau închisă

    event NewHighestBid(address indexed bidder, uint256 amount);
    event AuctionClosed(address indexed winner, uint256 amount);

    constructor(address _jobOwner) {
        jobOwner = _jobOwner;
        auctionActive = true;
    }

    /**
     * @dev Plasează un bid în licitație (funcție `payable`).
     *      Trebuie să fii atent la fallback/receive în contract pentru exces, 
     *      dar aici simplificăm.
     */
    function placeBid() external payable {
        require(auctionActive, "Licitatia s-a incheiat!");
        require(msg.value > highestBid, "Bid-ul tau nu depaseste bid-ul curent!");

        // dacă există deja un bid, îl returnăm celui care a licitat anterior
        if (highestBidder != address(0)) {
            // returnăm banii
            payable(highestBidder).transfer(highestBid);
        }

        highestBidder = msg.sender;
        highestBid = msg.value;

        emit NewHighestBid(msg.sender, msg.value);
    }

    /**
     * @dev Închide licitația (doar proprietarul job-ului).
     *      Suma rămâne blocată în acest contract până la confirmare din JobManagement.
     */
    function closeAuction() external {
        require(msg.sender == jobOwner, "Doar proprietarul jobului poate inchide licitatia!");
        require(auctionActive, "Licitatia este deja inchisa!");
        auctionActive = false;

        emit AuctionClosed(highestBidder, highestBid);
    }

    /**
     * @dev Transferă banii către proprietarul jobului (de exemplu, la final, sau
     *      către contractor — depinde de cum dorești să-l legi cu JobManagement).
     *      Aici doar un exemplu de funcție. În realitate se apelează din JobManagement.
     */
    function withdrawFunds(address _to) external {
        require(msg.sender == jobOwner, "Doar proprietarul jobului poate retrage fondurile!");
        // asigură-te că licitația este închisă
        require(!auctionActive, "Licitatia nu este inchisa!");

        uint256 amount = address(this).balance;
        require(amount > 0, "Nu exista fonduri de retras!");

        payable(_to).transfer(amount);
    }

    /**
     * @dev Returnează balanța contractului (exemplu de funcție `view`).
     */
    function getBalance() external view returns(uint256) {
        return address(this).balance;
    }
}

