// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "./UserManagement.sol";
import "./JobAuction.sol";

/**
 * @title JobManagement
 * @dev Contract pentru gestionarea joburilor. Interacționează cu UserManagement și (opțional) cu JobAuction.
 */
contract JobManagement {
    enum JobType { FIXED, AUCTION }
    enum JobStatus { OPEN, ASSIGNED, CLOSED, CANCELLED }

    struct Job {
        address owner;              // cine a creat job-ul
        string description;         // descriere job
        string experienceRequired;  // experienta necesara
        string knowledgeRequired;   // cunostinte necesare
        uint256 deadline;           // termen de finalizare (timestamp, block nr., etc.)
        uint256 amount;             // suma fixă (dacă e FIXED)
        JobType jobType;            // FIXED sau AUCTION
        JobStatus status;           // OPEN, ASSIGNED, etc.
        address assignedTo;         // cine a fost confirmat pe job
        address auctionContract;    // adresa contractului de licitatie (dacă e AUCTION)
    }

    // mapping de la jobId la structura job
    mapping(uint256 => Job) public jobs;
    uint256 public jobCounter;

    // pentru fiecare job, ținem o listă de aplicanți
    mapping(uint256 => address[]) public jobApplicants;

    // referință la contractul de user management
    UserManagement public userManagement;

    // evenimente
    event JobCreated(uint256 indexed jobId, address indexed owner, JobType jobType);
    event JobApplied(uint256 indexed jobId, address indexed applicant);
    event JobAssigned(uint256 indexed jobId, address indexed assignedTo);
    event JobCancelled(uint256 indexed jobId);
    event PaymentSent(uint256 indexed jobId, address indexed to, uint256 amount);

    constructor(address _userManagementAddress) {
        userManagement = UserManagement(_userManagementAddress);
    }

    // modifier care verifică dacă un user este înregistrat
    modifier onlyRegistered() {
        require(userManagement.checkIfRegistered(msg.sender), "Nu esti inregistrat in platforma!");
        _;
    }

    // modifier pentru a verifica daca e proprietar al jobului
    modifier onlyJobOwner(uint256 _jobId) {
        require(jobs[_jobId].owner == msg.sender, "Nu esti proprietarul jobului!");
        _;
    }

    /**
     * @dev Creează un job nou (exemplu de funcție `external`).
     * @param _description Descriere job
     * @param _experienceRequired Experienta necesara
     * @param _knowledgeRequired Cunostinte necesare
     * @param _deadline Termen (block.timestamp + x secunde, de ex.)
     * @param _amount Suma fixă (dacă e FIXED)
     * @param _jobType 0 => FIXED, 1 => AUCTION
     */
    function createJob(
        string calldata _description,
        string calldata _experienceRequired,
        string calldata _knowledgeRequired,
        uint256 _deadline,
        uint256 _amount,
        JobType _jobType
    )
        external
        payable
        onlyRegistered
    {
        // incrementăm un jobCounter global ca ID
        jobCounter++;

        // dacă e licitație, creăm un contract nou de tip JobAuction
        address auctionAddr;
        if (_jobType == JobType.AUCTION) {
            // la crearea contractului JobAuction, proprietarul devine msg.sender
            JobAuction newAuction = new JobAuction(msg.sender);
            auctionAddr = address(newAuction);
        }

        jobs[jobCounter] = Job({
            owner: msg.sender,
            description: _description,
            experienceRequired: _experienceRequired,
            knowledgeRequired: _knowledgeRequired,
            deadline: _deadline,
            amount: _amount,
            jobType: _jobType,
            status: JobStatus.OPEN,
            assignedTo: address(0),
            auctionContract: auctionAddr
        });

        emit JobCreated(jobCounter, msg.sender, _jobType);
    }

    /**
     * @dev Aplica la un job (exemplu: un job de tip FIXED sau licitatie).
     * @param _jobId ID-ul jobului la care aplici.
     */
    function applyToJob(uint256 _jobId) external onlyRegistered {
        Job storage job = jobs[_jobId];
        require(job.status == JobStatus.OPEN, "Jobul nu mai este disponibil!");
        // adaugă adresa userului la jobApplicants
        jobApplicants[_jobId].push(msg.sender);

        emit JobApplied(_jobId, msg.sender);
    }

    /**
     * @dev Permite proprietarului jobului să asigneze jobul unui aplicant (doar dacă jobul e OPEN).
     *      Dacă e licitație, proprietarul poate închide licitația și alege cel mai bun bid (ex. highestBidder).
     * @param _jobId ID-ul jobului
     * @param _applicant Adresa aplicantului pe care îl confirmăm
     */
    function assignJob(uint256 _jobId, address _applicant) external onlyJobOwner(_jobId) {
        Job storage job = jobs[_jobId];
        require(job.status == JobStatus.OPEN, "Jobul nu mai este OPEN!");

        // (opțional) se poate verifica dacă `_applicant` se află în lista de `jobApplicants[_jobId]`
        //  pentru siguranță sporită. Aici sărim peste acest pas.

        job.assignedTo = _applicant;
        job.status = JobStatus.ASSIGNED;

        emit JobAssigned(_jobId, _applicant);
    }

    /**
     * @dev Anulează/șterge jobul dacă nimeni nu a fost confirmat (status OPEN).
     * @param _jobId ID-ul jobului
     */
    function cancelJob(uint256 _jobId) external onlyJobOwner(_jobId) {
        Job storage job = jobs[_jobId];
        require(job.status == JobStatus.OPEN, "Jobul nu e OPEN deci nu poate fi sters!");
        job.status = JobStatus.CANCELLED;

        emit JobCancelled(_jobId);
    }

    /**
     * @dev Trimite plata către contractor (aplică pt FIXED). 
     *      În cazul licitațiilor, putem folosi `withdrawFunds` din JobAuction.
     * @param _jobId ID-ul jobului
     */
    function payContractor(uint256 _jobId) external payable onlyJobOwner(_jobId) {
        Job storage job = jobs[_jobId];

        // doar job ASSIGNED poate fi plătit
        require(job.status == JobStatus.ASSIGNED, "Jobul nu este in status ASSIGNED!");
        require(job.jobType == JobType.FIXED, "Acest job nu este de tip FIXED!");

        address contractor = job.assignedTo;
        require(contractor != address(0), "Nu avem un contractor asignat!");

        // Suma jobului
        uint256 amount = job.amount;
        require(msg.value == amount, "Trebuie sa trimiti exact amount-ul jobului!");

        // Trimite banii contractorului
        payable(contractor).transfer(amount);

        // Schimbăm statusul
        job.status = JobStatus.CLOSED;

        emit PaymentSent(_jobId, contractor, amount);
    }

    /**
     * @dev Funcție de exemplu: dacă job e de tip AUCTION, proprietarul jobului
     *      poate apela withdraw-ul din JobAuction pentru a transfera fondurile
     *      către contractor. În realitate, ar trebui să stabilești clar când și cum.
     */
    function finalizeAuction(uint256 _jobId, address _contractor) external onlyJobOwner(_jobId) {
        Job storage job = jobs[_jobId];
        require(job.jobType == JobType.AUCTION, "Jobul nu este licitatie!");
        require(job.status == JobStatus.ASSIGNED, "Jobul nu este in status ASSIGNED!");
        require(job.auctionContract != address(0), "Nu exista contract de licitatie!");

        // Apelăm contractul de licitație
        JobAuction auction = JobAuction(job.auctionContract);

        // Asigură-te că licitația e închisă (closeAuction() deja apelat). 
        // Apoi proprietarul jobului poate să retragă fondurile acolo și să le trimită contractorului real.
        // În exemplu, trimitem direct către `_contractor`.
        auction.withdrawFunds(_contractor);

        job.status = JobStatus.CLOSED;
        emit PaymentSent(_jobId, _contractor, auction.highestBid());
    }

    /**
     * @dev Returnează array-ul de aplicanți pentru un job (exemplu de funcție `view`).
     */
    function getApplicants(uint256 _jobId) external view returns (address[] memory) {
        return jobApplicants[_jobId];
    }
}

