// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.27;

// Uncomment this line to use console.log
// import "hardhat/console.sol";

contract Lock {
    uint public unlockTime;
    address payable public owner;

    event Withdrawal(uint amount, uint when);

    constructor(uint _unlockTime) payable {
        require(
            block.timestamp < _unlockTime,
            "Unlock time should be in the future"
        );

        unlockTime = _unlockTime;
        owner = payable(msg.sender);
    }

    function withdraw() public {
        // Uncomment this line, and the import of "hardhat/console.sol", to print a log in your terminal
        // console.log("Unlock time is %o and block timestamp is %o", unlockTime, block.timestamp);

        require(block.timestamp >= unlockTime, "You can't withdraw yet");
        require(msg.sender == owner, "You aren't the owner");

        emit Withdrawal(address(this).balance, block.timestamp);

        owner.transfer(address(this).balance);
    }
}

contracts/UserManagement.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

/**
 * @title UserManagement
 * @dev Gestionarea userilor înregistrați. 
 */
contract UserManagement {
    // mapping care reține dacă un address este înregistrat sau nu
    mapping(address => bool) private isRegistered;

    // eveniment emis când se înregistrează un nou user
    event UserRegistered(address indexed user);

    // modifier care restricționează accesul doar la userii înregistrați
    modifier onlyRegisteredUser() {
        require(isRegistered[msg.sender], "Nu esti inregistrat in platforma!");
        _;
    }

    /**
     * @dev Înregistrează un user nou. 
     *      Oricine poate apela această funcție să se înregistreze (dacă nu e deja înregistrat).
     */
    function registerUser() external {
        require(!isRegistered[msg.sender], "User deja inregistrat!");
        isRegistered[msg.sender] = true;
        emit UserRegistered(msg.sender);
    }

    /**
     * @dev Verifică dacă un user este înregistrat (exemplu de funcție `view`).
     * @param user Adresa userului pentru care verificăm.
     * @return true dacă userul este înregistrat, altfel false.
     */
    function checkIfRegistered(address user) external view returns (bool) {
        return isRegistered[user];
    }

    /**
     * @dev Funcție externă care returnează 2+2 = 4 (exemplu de funcție `pure`).
     *      Nu folosește date on-chain și nu costă gas (în afară de costul de apel).
     */
    function four() external pure returns (uint256) {
        return 2 + 2;
    }
}

